import '../styles/Home.css';
import React from 'react';
import pic from './img/pic1.jpg'

function Home() {
  return (
    <div className='header' 
    style={{ backgroundImage:`url(${pic})` , 
    backgroundRepeat: 'no-repeat', width: '800px'}}>
        <p><strong>Welcome to NavTask!</strong></p>
        
    </div>
  );
}

export default Home;
